import React, { useState } from 'react';

function Profile() {
  const [profile, setProfile] = useState({ name: '', skills: '' });

  const handleChange = (e) => {
    setProfile({ ...profile, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Call API to save profile
  };

  return (
    <div>
      <h1>Create/Edit Profile</h1>
      <form onSubmit={handleSubmit}>
        <input name="name" value={profile.name} onChange={handleChange} placeholder="Name" />
        <input name="skills" value={profile.skills} onChange={handleChange} placeholder="Skills" />
        <button type="submit">Save</button>
      </form>
    </div>
  );
}

export default Profile;
